import React from 'react'

export default class Overview extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        data1: [],
        data2: []
      };
    }

    componentDidMount() {
        Promise.all([
            fetch('https://backend.kardiachain.io/api/v1/contracts?page=1&limit=50&type=KRC20&status=Verified').then(res => res.json()),
            fetch('https://api.info.kaidex.io/api/tokens').then(res => res.json())
        ]).then(([urlOneData, urlTwoData]) => {
            this.setState({
                isLoaded: true,
                data1: urlOneData,
                data2: urlTwoData
            });
        },
        (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )  
    }

    render() {
      const { error, isLoaded, data1, data2 } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {     
        return (
            <div>
                {console.log(data1)}
            </div>
        )
      }
    }
  }
